    return TextTheme(
      displayLarge: twinkleStar(textStyle: textTheme.displayLarge),
      displayMedium: twinkleStar(textStyle: textTheme.displayMedium),
      displaySmall: twinkleStar(textStyle: textTheme.displaySmall),
